import React from "react";
import Card from "react-bootstrap/Card";
import { ListGroup, Container, Row, Col, Badge } from "react-bootstrap";
import "../index.css";
import "./Coaching.css";

const offer = [
  "online programming",
  "weekly+ checkins",
  "lifting technique review",
  "nutrition information and strategies",
];
const philosophy = [
  "consistency",
  "self-efficacy",
  "find a way to train that you enjoy",
  "embrace the process",
];
const programming = [
  "individualized: each program is taylored to your goals and your training history",
  "auto-regulated: we all have good days and bad days––I want you to make the most of both",
  "data-driven: after every block, we look back to make sure what we're doing is working",
  "sustainable: evidence-based injury risk reduction and management so you continue to lift for the rest of your life",
];
const powerlifting = ["Specalize your squat, bench and deadlift", "Compete"];
const health = [
  "Build muscle",
  "Lose fat",
  "Meet (then exceed) exercise guidelines for health",
];

class Section extends React.Component {
  //props={header, items}
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        <Container>
          <Row>
            <Col>
              <Row>
                <Badge
                  style={{
                    backgroundColor: "DarkSlateGray",
                    paddingLeft: "3vw",
                    paddingRight: "3vw",
                    fontSize: "24px",
                    color: "white",
                  }}
                >
                  {this.props.header}
                </Badge>
              </Row>
              {this.props.items.map((item, i) => (
                <Row>
                  <Badge className="label">-{item}</Badge>
                </Row>
              ))}
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default class Coaching extends React.Component {
  /* cards: 
  - I offer:
    - online programming
    - weekly+ checkins
    - lifitng technique review
    - nutrition information and effective diet strategies 
  - My philosophy is:
    - Consistency
    - Self-efficacy
    - Find a way to train that you enjoy 
    - Embrace the process
  - My programming is:
    - individualized: each program is taylored to your goals and your training history
    - auto-regulated: we all have good days and bad days––I want you to make the most of both 
    - data-driven: after every week and every block, we look back to make sure what we're doing is working
    - sustainable: evidence-based injury risk reduction and management so you continue to lift for the rest of your life
  - Powerlifting, img 
    - Maximize Squat, Bench, Deadlift 
  - Strength and Conditioning, img
    - Meet exercise guidelines for health
    - Improve your body composition
    - Build muscle, lose fat
    */

  render() {
    return (
      <div className="coaching">
        <Container>
          <Row>
            <Col>
              <Section header={"I offer"} items={offer} />
              <Card text="white" className="mb-2" bg="secondary">
                <Card.Title>
                  <Badge
                    style={{
                      backgroundColor: "DarkSlateGray",
                      paddingLeft: "3vw",
                      paddingRight: "3vw",
                      fontSize: "24px",
                    }}
                  >
                    My philosophy is
                  </Badge>
                </Card.Title>
                {philosophy.map((item, i) => (
                  <element className="label">-{item}</element>
                ))}
              </Card>
              <Card text="white" className="card" bg="secondary">
                <Card.Title>
                  <Badge
                    style={{
                      backgroundColor: "DarkSlateGray",
                      paddingLeft: "3vw",
                      paddingRight: "3vw",
                      fontSize: "24px",
                    }}
                  >
                    My programming is
                  </Badge>
                </Card.Title>
                {programming.map((item, i) => (
                  <element className="label">-{item}</element>
                ))}
              </Card>
            </Col>
            <Col>
              <Card text="white" className="card" bg="secondary">
                <Card.Title>
                  <Badge
                    style={{
                      backgroundColor: "DarkSlateGray",
                      paddingLeft: "3vw",
                      paddingRight: "3vw",
                      fontSize: "24px",
                    }}
                  >
                    Powerlifting
                  </Badge>
                </Card.Title>
                {powerlifting.map((item, i) => (
                  <element className="label">-{item}</element>
                ))}
              </Card>
              <Card text="white" className="card" bg="secondary">
                <Card.Title>
                  <Badge
                    style={{
                      backgroundColor: "DarkSlateGray",
                      paddingLeft: "3vw",
                      paddingRight: "3vw",
                      fontSize: "24px",
                    }}
                  >
                    Strength and Conditioning
                  </Badge>
                </Card.Title>
                {health.map((item, i) => (
                  <element className="label">-{item}</element>
                ))}
              </Card>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}
